async with get_database() as database:
    assert await database.select_min(ExchangeDataTables.OHLCV, ['timestamp']
        ) == [(1500249600,)]
    assert await database.select_min(ExchangeDataTables.OHLCV, ['timestamp'
        ], time_frame='1h') == [(1587945600,)]
    assert await database.select_min(ExchangeDataTables.OHLCV, ['timestamp'
        ], ['symbol'], time_frame='1h') == [(1587945600, 'ETH/BTC')]
